import React, { useState } from 'react';
import './Header.css';

const Header = () => {
  const [searchTerm, setSearchTerm] = useState('');

  const handleSearch = () => {
    if (searchTerm.trim()) {
      alert(`Searching for: ${searchTerm}`);
      // In a real app, this would trigger search functionality
    }
  };

  const handleNavClick = (navItem) => {
    alert(`Navigating to ${navItem}`);
    // In a real app, this would use React Router
  };

  const handleSignIn = () => {
    alert('Opening Sign In modal');
    // In a real app, this would open authentication modal
  };

  const handleJoinAsPro = () => {
    alert('Opening Professional Registration');
    // In a real app, this would navigate to pro registration
  };

  return (
    <header className="header">
      <div className="container">
        <div className="header-content">
          <div className="logo">
            <img src="/logo.svg" alt="houzz" className="logo-img" />
          </div>
          
          <nav className="nav">
            <div className="nav-item dropdown">
              <span>Photos</span>
              <span className="dropdown-arrow">‚ñº</span>
            </div>
            <div className="nav-item dropdown">
              <span>Find Professionals</span>
              <span className="dropdown-arrow">‚ñº</span>
            </div>
            <div className="nav-item dropdown">
              <span>Advice</span>
              <span className="dropdown-arrow">‚ñº</span>
            </div>
          </nav>

          <div className="search-container">
            <input
              type="text"
              placeholder="Search Houzz"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="search-input"
            />
            <button className="search-btn">üîç</button>
          </div>

          <div className="auth-buttons">
            <button className="btn btn-secondary">Sign In</button>
            <button className="btn btn-primary">Join as a Pro</button>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
